.o-nav__item.o-nav__item:hover,.o-nav--meta>.open>.o-nav__item,.dropdown-menu>li>a:hover,.dropdown-menu>li>a:visited{background-color:#222;color:#fff;}
.t-gender-male .header-background-cover,#header-feed{display:none;}
.bg-white,.u-bg-white{background-color:#222!important;}
.bg-gray-light,.bg-gray,.t-gender-male .panel-group .panel .panel-heading.active,.t-gender-male .modal-header{background-color:#349886!important;}
